\section{Useful Relations in Very Special Geometry}

\label{usefulrel}

We list here some useful relations that can be proven using the
techniques of very special geometry:

\begin{equation}
\partial_i X_I = -\frac 23 G_{IJ} \partial_i X^J\,, \qquad
X_I = \frac 23 G_{IJ} X^J\,.
\end{equation}

\begin{equation}
G_{IJ} = \frac 92 X_I X_J - \frac 12 C_{IJK} X^K\,, \label{G_IJ}
\end{equation}

\begin{equation}
G^{IJ} = 2 X^I X^J - 6 C^{IJK} X_K\,, \label{G^IJ}
\end{equation}

where the $C^{IJK}$ are defined by

\begin{equation}
C^{IJK} = \delta^{II'}\delta^{JJ'}\delta^{KK'} C_{I'J'K'}\,. \label{C^IJK}
\end{equation}

Eqn.~(\ref{G^IJ}) can be shown using the ``adjoint identity''

\begin{equation}
C_{IJK} C_{J'\left(LM\right.} C_{\left.PQ\right)K'} \delta^{JJ'}\delta^{KK'}
= \frac 43 \delta_{I\left(L\right.} C_{\left.MPQ\right)}
\end{equation}

of the associated Jordan algebra \cite{Gunaydin:1983bi}. Using (\ref{G^IJ})
one obtains furthermore

\begin{equation}
X^I = \frac 92 C^{IJK} X_J X_K\,,
\end{equation}

and

\begin{equation}
\frac 92 C^{IJK} X_I X_J X_K = 1\,. \label{CXXX}
\end{equation}

The scalar potential (\ref{scalarpot1}) can also be written as \cite{Behrndt:1998jd}

\begin{equation}
V(X) = 9 V_I V_J \left(X^I X^J - \frac 12 G^{IJ}\right)\,.
\end{equation}

Using (\ref{G^IJ}), this can be cast into the form

\begin{equation}
V(X) = 27 C^{IJK} V_I V_J X_K\,. \label{scalarpot2}
\end{equation}




\section{Solutions with nonconstant Scalars for $k = \pm 1$}
\label{solnonconst}


For the STU model considered in section \ref{nonconst}, we
introduce the rescaled fields $x^I = re^W X^I$ so that $x^1 x^2 x^3 = r^3 e^{3W}$.
The equations (\ref{chargequant}), (\ref{gXV}), (\ref{Z}) and (\ref{flowequ}) become

\begin{eqnarray}
& & g \sum_I q^I = 1\,, \\
& & g \sum_I x^I = -\left( 2\dot V +\dot W +1 \right)\,, \label{11} \\
& & k \sum_I \frac{q^I}{x^I} = -2 \left( \dot W +1-\dot V \right) \label{22}\,, \\
& & -kq^I -\dot x^I +2gx^{I2} +(2\dot V +\dot W +1 )x^I = 0\,, \label{33}
\end{eqnarray}

where the dot denotes a derivative with respect to $u = \ln gr$.
Using (\ref{11}) in (\ref{33}) we find

\begin{eqnarray}
& & kq^1 +\dot x^1 + g(-x^1 + x^2 + x^3) x^1 = 0\,, \nonumber \\
& & kq^2 +\dot x^2 + g(x^1 - x^2 + x^3) x^2 = 0\,, \label{system} \\
& & kq^3 +\dot x^3 + g(x^1 + x^2 - x^3) x^3 = 0\,. \nonumber
\end{eqnarray}

Note that from $x^1 x^2 x^3 = r^3 e^{3W}$ we derive

\begin{eqnarray}
3(\dot W + 1) = \sum_I \frac{\dot{x}^I}{x^I}\,,
\end{eqnarray} 

which confronted with the sum of (\ref{11}) and (\ref{22}) gives the 
consistency condition

\begin{eqnarray}
\sum_I \frac{\dot{x}^I}{x^I} = -g \sum_I x^I - k \sum_I \frac{q^I}{x^I}\,,
\end{eqnarray}

which is satisfied by the system (\ref{system}).

One can then solve the Eqns.~(\ref{system}) and use
$x^1 x^2 x^3 = r^3 e^{3W}$ to find $W$ and finally (\ref{11}) or (\ref{22})
to determine $V$ so that

\begin{eqnarray}
ds^2 = (\prod_I x^I)^{-\frac 13} e^{-g \int \sum_J x^J du}
(-dt^2 +dz^2) +(\prod_I x^I)^{\frac 23} (du^2 + d\Omega_k^2 )\,.
\end{eqnarray}

If we introduce the functions

\begin{eqnarray}
& & y^1 = x^1 + x^2 - x^3\,, \nonumber \\
& & y^2 = x^1 - x^2 - x^3\,, \nonumber \\
& & y^3 = x^1 - x^2 + x^3\,, \nonumber
\end{eqnarray}

and the constants

\begin{eqnarray}
& & Q^1 = -k(q^1 +q^2 -q^3 )\,, \nonumber \\
& & Q^2 = -k(q^1 -q^2 -q^3 )\,, \nonumber \\
& & Q^3 = -k(q^1 -q^2 +q^3 )\,, \nonumber
\end{eqnarray}

the system (\ref{system}) becomes

\begin{eqnarray}
& & Q^1 - \dot y^1 + g y^2 y^3 = 0\,, \label{y1} \\
& & Q^2 - \dot y^2 + g y^1 y^3 = 0\,, \label{y2} \\
& & Q^3 - \dot y^3 + g y^1 y^2 = 0\,. \label{y3}
\end{eqnarray}

From (\ref{y1}) and (\ref{y2}) one finds

\begin{eqnarray}
& & y^1 + y^2 = e^{g \int y^3 du} \left[(Q^1 + Q^2) \int e^{- g\int y^3 du} du + K_+
\right]\,, \nonumber \\
& & y^1 - y^2 = e^{-g \int y^3 du} \left[(Q^1 - Q^2) \int e^{g\int y^3 du} du + K_- \right]\,,
          \nonumber
\end{eqnarray}

where $K_{\pm}$ denote integration constants.
Using these expressions in (\ref{y3}) one obtains an integro-differential equation for
$y^3$ which is quite complicated. However a solution can be found e.~g.~in the simple
case $Q^1 + Q^2 = 0$ and $K_+ = 0$. This corresponds to

\begin{displaymath}
q^1 = q^3\,, \qquad q^2 = \frac 1g - 2q^1\,.
\end{displaymath}

If we introduce the function

\begin{displaymath}
h = Q^1 \int e^{g\int y^3 du} du + \frac{K_-}{2}\,,
\end{displaymath}

we obtain

\begin{displaymath}
y^1 = -y^2 = Q^1\frac{h}{\dot h}\,.
\end{displaymath}

Eqn.~(\ref{y3}) becomes

\begin{eqnarray}
\partial^2_u \ln\dot h = g Q^3 - \left(\frac{g Q^1 h}{\dot h}\right)^2\,.
                              \label{diffequh}
\end{eqnarray}

A special solution can be found using the ansatz

\begin{eqnarray}
h(u) = h_0 e^{\alpha u^2}\,,
\end{eqnarray}

which solves (\ref{diffequh}) if

\[
\alpha = \frac g2 Q^3\,, \qquad Q^1 = \pm Q^3\,.
\]

Choosing the plus\footnote{The minus sign leads to a solution where some of
the moduli $X^I$ become negative. We discard this unphysical case.} we get
the solution (\ref{sergio}).





